const Navbar = () => {
  return (
    <div
      style={{ height: 80, width: "100%", background: "red", display: "flex" }}
    >
      <div style={{ flex: 3, background: "white" }}></div>
      <div style={{ flex: 4, background: "gray" }}></div>
      <div style={{ flex: 3, background: "white" }}></div>
    </div>
  );
};

export default Navbar;
